import styled from "styled-components";

export const SDetail = styled.div`
  width: 100%;
  height: auto;
  margin: 0 auto;
  padding: 10% 20% 20% 20%;
  background-color: #fff;
  font-size: 1.2em;
  font-weight: 150;
  text-align: center;
`
export const SSection = styled.section`
  width: 100%;
  display: block;
`
